Macrolepiota procera, the Parasol Mushroom, is a choice edible species found on roadside verges, in neglected pastureland and on grassy seaside cliffs in summer and autumn.

The Parasol Mushroom/Lepiota may be a better one for intermediate and advanced collectors. They have exceptionally fine flavor though. One of the absolute best. Although it is not that hard to identify you must be exceptionally observant of all characteristics. You cannot afford a mistake. There are some Lepiota relatives that are very poisonous or even deadly. You also cannot make the mistake of collecting an amanita!
